import React from "react"
import MyPosts from "./MyPosts/MyPosts"
import ProfileInfo from "./ProfileInfo"

const Profile = (props) => {
  return (
    <>
      <ProfileInfo />
      <MyPosts posts={props.profilePage.posts} addPost={props.addPost} />
    </>
  )
}

export default Profile
